import React from "react";

class Title extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      s: 5000,
    };
  }
  componentDidMount() {
    this.setState({
      s: this.props.countdown(this.state.s),
    });
  }

  render() {
    const { s } = this.state;
    return (
      <>
        <p style={{ fontSize: 40 }}>{s}</p>
      </>
    );
  }
}
export default Title;
